function recApiQuery(latitudeVal,longitudeVal,radiusVal,activityVal,callback) {

    var recQueryURL = "https://ridb.recreation.gov/api/v1/recareas.json?apikey=2C1B2AC69E1945DE815B69BBCC9C7B19&full&latitude="
    + latitudeVal + "&longitude=" + longitudeVal + "&radius=" + radiusVal + "&activity=" + activityVal;

        $.ajax({
            url: recQueryURL,
            method: "GET"
        })
        .done(callback);
}

function recApiById(id, callback) {

    var recQueryURL = "https://ridb.recreation.gov/api/v1/recareas/" + id + ".json?apikey=2C1B2AC69E1945DE815B69BBCC9C7B19&full"

        $.ajax({
            url: recQueryURL,
            method: "GET"
        })
        .done(callback);
}

function makeEmojis(state, recarea){
  var container = $('<span class="rec-emojis">');
  var filtered = state.recreation.status.filteredActivities;
  recarea.ACTIVITY
  .sort((a, b) => {
    if(filtered[a.ActivityID] && !filtered[b.ActivityID]){
      return -1;
    }
    else if(!filtered[a.ActivityID] && filtered[b.ActivityID]){
      return 1;
    }
    else{
      return a.ActivityName > b.ActivityName ? 1 : -1;
    }
  })
  .forEach((activity) => {
    var img = $(emojiMap[activity.ActivityID]);
    img.attr('title', activity.ActivityName)
    container.append(img);
  })
  return container;
}


